import React, { useState } from 'react';

const Results = ({
    thumbnail,
    title,
    authors,
    description,
    previewLink
}) => {
    return (
        <div>
            <div className="card">
                <div className="card-body">
                    <span>{title}</span>
                </div>
            </div>
        </div>
    )
}

export default Results;
